import React from "react";
import Home from "./Components/Home";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Classic from "./Components/Classic";

export default function App() {
  return (

      <Router>
          <Switch>

              <Route exact path="/">
                 <Home />
              </Route>

              <Route path="/classic">
                  
                      <Classic />
              </Route>
    
          </Switch>
      </Router>
    
  );
  
};
